class Solution:
    def findTheDifference(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: str
        """
        s = list(s)
        s.sort()
        s = ''.join(s)
        t = list(t)
        t.sort()
        t = ''.join(t)

        r = ''

        for i in t:
            if s != '' and i == s[0]:
                s = s[1:]
            else:
                r += i

        return r

if __name__ == '__main__':
    s = ""
    t = ""
    r = Solution().findTheDifference(s, t)
    print(r)